  `status` tinyint(1) DEFAULT NULL COMMENT '用户状态 0：关闭，1：开启',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8 COMMENT='用户表';

